import {  Route, Routes} from 'react-router-dom';
import Home from './components/Home/Home';
import Form from './components/Form';



function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />}/>
          <Route path="/" element={<Form />} />


      </Routes>
    </>
  )
}

export default App;
